import { LoginForm } from '../components/LoginForm/LoginForm';

export default function Login() {
  return (
    <HelmetProvider>
      <div>
        <Helmet>
          <title>Log In</title>
        </Helmet>
        <LoginForm />
      </div>
    </HelmetProvider>
  );
}
